import React, { Component } from 'react';
import PropTypes from 'prop-types';
import styles from './PageHeader.module.css';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class PageHeader extends Component{
  render() {
    console.log(this.props.components);
    return (
      <div className={styles.PageHeader}>
        <Navbar bg="light" expand={false}>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="text-center" defaultActiveKey="/">
              {(() => {
                let components = [];
                this.props.components.forEach(
                  (value, key) => components.push(
                    <Nav.Link href="/$key">{value.className.replace(/([A-Z])/g, ' $1').trim()}</Nav.Link>
                  ))
                return components;
              })()}
              {/* <Nav.Link href="/">Start</Nav.Link>
              <Nav.Link href="/questions">Answer Questions</Nav.Link>
              <Nav.Link href="/date">Set Date</Nav.Link>
              <Nav.Link href="/completion">Review Form</Nav.Link> */}
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}

export default PageHeader;
